import React, {useState} from 'react';

import './InputSpinner.css';


const InputSpinner = ({TEST}) => {

    const [count, setCount] = useState(0)
    const onIncrements = ()=>{
        setCount(count + 1);
    };
    const onDecrements = ()=>{
        setCount(count - 1);
    };

    return (

        <div className="InputSpinner horizontal">

            <img src="https://alikinvv.github.io/stepper/build/img/arrow.svg" onClick={onDecrement} className="arrow top" alt="" />
            <div className="box">
                <div className="numbers1"> { count } </div>
            </div>
            <img src="https://alikinvv.github.io/stepper/build/img/arrow.svg" onClick={onIncrement} className="arrow bottom" alt="" />
        </div>
    );
};






export default InputSpinner;
